import React, { useContext } from 'react';
import { Link } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faShoppingCart } from '@fortawesome/free-solid-svg-icons';
import 'bootstrap/dist/css/bootstrap.min.css';
import { CartContext } from './cart/CartContext';
import '../css/navbar/navbar.css';



const Navbar = () => {
    const { cart } = useContext(CartContext);

    // Function to handle logout
    const handleLogout = () => {
        // Clear user data from localStorage
        localStorage.removeItem('user');
        // Force a re-render to update the navbar
        window.location.reload();
    };

    // Get user data from local storage
    const user = JSON.parse(localStorage.getItem('user'));

    return (
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <div className="container-fluid">
                <Link className="navbar-brand" to="/">E-Commerce Store</Link>
                <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                        <li className="nav-item">
                            <Link className="nav-link" to="/">Home</Link>
                        </li>
                        <li className="nav-item">
                            <Link className="nav-link" to="/products">Products</Link>
                        </li>
                        <li className="nav-item">
                            <Link className="nav-link" to="/about">About</Link>
                        </li>
                        <li className="nav-item">
                            <Link className="nav-link" to="/contact">Contact</Link>
                        </li>
                    </ul>
                    <form className="d-flex">
                        {user ? (
                            <div className="dropdown">
                                <button className="btn btn-secondary dropdown-toggle" type="button" id="dropdownMenuButton1" data-bs-toggle="dropdown" aria-expanded="false">
                                    Welcome, {user.firstName}!
                                </button>
                                <ul className="dropdown-menu" aria-labelledby="dropdownMenuButton1">
                                    <li><Link className="dropdown-item" to="/profile">Profile</Link></li>
                                    <li><Link className="dropdown-item" to="/settings">Settings</Link></li>
                                    <li><button className="dropdown-item" onClick={handleLogout}>Logout</button></li>
                                </ul>
                            </div>
                        ) : (
                            <>
                                <Link to="/login" className="btn btn-outline-success me-2">Login</Link>
                                <Link to="/register" className="btn btn-success">Register</Link>
                            </>
                        )}
                        <Link to="/cart" className="btn btn-primary ms-2">
                            <FontAwesomeIcon icon={faShoppingCart} />
                            <span className="badge bg-danger ms-1">{cart.length}</span>
                        </Link>
                    </form>
                </div>
            </div>
        </nav>
    );
};

export default Navbar;
